import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Add an item to the cart to enable the remove functionality
    // Using a role-based selector for accessibility and robustness
    await page.getByRole('button', { name: 'Add to Cart' }).first().click();
    await page.waitForSelector('.notification.success', { timeout: 5000 }); // Wait for "added to cart" notification
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // 2. Open the cart modal
    // The cart element is a div with class 'cart'
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { timeout: 5000 }); // Wait for the item to appear in the modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal_open.png'));

    // 3. Remove the item from the cart
    // The remove button has the text 'Remove'
    await page.getByRole('button', { name: 'Remove' }).click();
    await page.waitForSelector('.empty-cart', { timeout: 5000 }); // Wait for the "cart is empty" message
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_item_removed.png'));

    // 4. Extract data to verify completion
    const emptyCartMessage = await page.locator('.empty-cart').textContent();

    return {
      success: true,
      action: "Successfully removed an item from the cart.",
      extractedData: {
        confirmationMessage: emptyCartMessage
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
